import React from "react";
import {useHistory} from "react-router-dom";

export function PropPush(props){
    const history = useHistory()
   const explore = () =>{
       history.push("/customer")
   }
   return(
       <div>
           <input type="submit" value="change" onChange={explore}/>
       </div>
   )
}
